    @classmethod
    def read_schedule_status(cls,applyId:str,start:str,end:str,scheme:str):
        '''
        获取当前排班状态
        :param applyId:
        :param date:
        :return:
        '''
        result = None
        conn = cls.get_connection()
        with conn.cursor() as cursor:

            sql = """
                    select `applyId`,`condition`,`date`,`scheme_type` from schedule_status where `applyId`=%s and `date`>=%s  and `date`<=%s and `scheme_type`=%s and status=1
                    """
            #print(sql %(applyId,start,end,scheme))
            try:
                cursor.execute(sql, (applyId,start,end,scheme))
                result = cursor.fetchall()
                conn.commit()
            except Exception as e:
                print(e)
                conn.rollback()
        conn.close()
        return result

